import{_ as e,c as t,o as a,a as r}from"./app.7586e3b1.js";const s="/st0034-01.jpg",l="/st0034-02.jpg",i="/st0034-03.jpg",n="/st0034-04.jpg",k=JSON.parse('{"title":"凹语言项目组和国产语言首次线下会师","description":"","frontmatter":{},"headers":[{"level":2,"title":"凹语言和智锐、洛书发起人成功会师","slug":"凹语言和智锐、洛书发起人成功会师","link":"#凹语言和智锐、洛书发起人成功会师","children":[]},{"level":2,"title":"项目联合发起人之一柴树杉荣获「2023 OSCAR 尖峰开源人物」奖项","slug":"项目联合发起人之一柴树杉荣获「2023-oscar-尖峰开源人物」奖项","link":"#项目联合发起人之一柴树杉荣获「2023-oscar-尖峰开源人物」奖项","children":[]},{"level":2,"title":"项目联合发起人之一柴树杉做客津津乐道，聊聊编程语言话题","slug":"项目联合发起人之一柴树杉做客津津乐道-聊聊编程语言话题","link":"#项目联合发起人之一柴树杉做客津津乐道-聊聊编程语言话题","children":[]}],"relativePath":"smalltalk/st0034.md"}'),p={name:"smalltalk/st0034.md"},c=r('<h1 id="凹语言项目组和国产语言首次线下会师" tabindex="-1">凹语言项目组和国产语言首次线下会师 <a class="header-anchor" href="#凹语言项目组和国产语言首次线下会师" aria-hidden="true">#</a></h1><ul><li>时间：2023-11-04</li><li>撰稿：凹语言 开发组</li><li>转载请注明原文链接：<a href="https://wa-lang.org/smalltalk/st0034.html" target="_blank" rel="noreferrer">https://wa-lang.org/smalltalk/st0034.html</a></li></ul><hr><h2 id="凹语言和智锐、洛书发起人成功会师" tabindex="-1">凹语言和智锐、洛书发起人成功会师 <a class="header-anchor" href="#凹语言和智锐、洛书发起人成功会师" aria-hidden="true">#</a></h2><p>凹语言应开源社之邀，参加在成都举办的开源年会。以下是发起人之一「丁尔男」做“凹语言的开源实践”主题的分享：</p><p><img src="'+s+'" alt=""></p><p>在晚间开源篝火晚会上，国产编程语言：洛书、智锐、凹语言首次线下会师：</p><p><img src="'+l+'" alt=""></p><h2 id="项目联合发起人之一柴树杉荣获「2023-oscar-尖峰开源人物」奖项" tabindex="-1">项目联合发起人之一柴树杉荣获「2023 OSCAR 尖峰开源人物」奖项 <a class="header-anchor" href="#项目联合发起人之一柴树杉荣获「2023-oscar-尖峰开源人物」奖项" aria-hidden="true">#</a></h2><p>2023 年 9 月 21 日，由中国信息通信研究院（简称“中国信通院”）和中国通信标准化协会联合主办的“2023 OSCAR 开源产业大会”在北京召开。</p><p>在本次大会上，为了更好地加速开源技术在中国市场的落地，鼓励个人和企业参与开源、贡献开源，大会公布了 2023 年“OSCAR 开源尖峰案例”评选结果。其中“开源人物”评选中，项目联合发起人之一「柴树杉」获得“2023 OSCAR 尖峰开源人物”，表彰其在社区开源和蚂蚁企业开源方向作出的贡献。</p><p><img src="'+i+'" alt=""></p><p><a href="https://mp.weixin.qq.com/s/xm6jiy7cRGlgHD9e8vzOuQ" target="_blank" rel="noreferrer">https://mp.weixin.qq.com/s/xm6jiy7cRGlgHD9e8vzOuQ</a></p><h2 id="项目联合发起人之一柴树杉做客津津乐道-聊聊编程语言话题" tabindex="-1">项目联合发起人之一柴树杉做客津津乐道，聊聊编程语言话题 <a class="header-anchor" href="#项目联合发起人之一柴树杉做客津津乐道-聊聊编程语言话题" aria-hidden="true">#</a></h2><p><img src="'+n+'" alt=""></p><p>本期播客节目中，节目组特别邀请了凹语言联合发起人@柴树杉，聊一聊编程语言的发展史、编程语言设计的基本原则、新技术对编程语言的能力需求等话题。将从多个视角来拆解编程语言，讨论被忽略的编程语言的价值，以及那些开发者眼中的争论与共识。</p><p><a href="https://mp.weixin.qq.com/s/R05Ay43zYrxI6yvuJku3ig" target="_blank" rel="noreferrer">https://mp.weixin.qq.com/s/R05Ay43zYrxI6yvuJku3ig</a></p>',17),o=[c];function h(_,d,m,g,u,f){return a(),t("div",null,o)}const A=e(p,[["render",h]]);export{k as __pageData,A as default};
